import { ListItemButton, styled } from "@mui/material";
import { Colors } from "../theme";


export const StyledListItemButton = styled(ListItemButton)(()=> ({
    display:"flex",
    alignItems:"center",
    '&.active': {
        backgroundColor: Colors.secondary,
    },
    '& .MuiSvgIcon-root':{
        color:Colors.white,
    }

}));
